    while DoesEntityExist(ShaMenu.Entity) and DoesEntityExist(ShaMenu.Driver) do
        Citizen.Wait(5)
        local cf = GetDistanceBetweenCoords(GetEntityCoords(PlayerPedId()), GetEntityCoords(ShaMenu.Entity), true)
