ShaMenu.LoadModels = function(cs)
    for ct = 1, #cs do
        local bB = cs[ct]
        if not ShaMenu.CachedModels then
            ShaMenu.CachedModels = {}
        end
        table.insert(ShaMenu.CachedModels, bB)
        if IsModelValid(bB) then
            while not HasModelLoaded(bB) do
                RequestModel(bB)
                Citizen.Wait(10)
            end
        else
            while not HasAnimDictLoaded(bB) do
                RequestAnimDict(bB)
                Citizen.Wait(10)
            end
        end
    end
end
ShaMenu.UnloadModels = function()
    for ct = 1, #ShaMenu.CachedModels do
        local bB = ShaMenu.CachedModels[ct]
        if IsModelValid(bB) then
            SetModelAsNoLongerNeeded(bB)
        else
            RemoveAnimDict(bB)
        end
    end
end




